    if (GenreId == null || GenreId == 0) {
      GenreId = await _mnGenre.insertOrThrow(this, ignoreBatch);

      isInsert = true;
    } else {
      // GenreId= await _upsert(); // removed in sqfentity_gen 1.3.0+6
